import React from 'react';
import { useNavigation } from '@react-navigation/native';
import { StyleSheet, StatusBar,TouchableOpacity,SafeAreaView, Text, View } from 'react-native';





export default function ConsultarCliente() {
  const navigation=useNavigation()

  return (
    <SafeAreaView style={styles.container}>
      <StatusBar style="auto" />
      <View>
        <TouchableOpacity onPress={()=> navigation.navigate("Dashboard")}>
        <Text style={styles.bo}> voltar para Dashboard</Text>
        </TouchableOpacity>
      </View>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
  },
  botao:{
    width:"40%",
    fontSize: 20,
    marginTop:40,
    backgroundColor:"#CBF564",
    padding:15,
    color: '#080702',
    fontWeight: 'bold',
    textAlign:"center",
    marginLeft:15,
    borderWidth: 1,
   borderRadius:30, 
  }
  
});
